// Get all incoming input data from the previous node
const allData = $input.all();

// Extract the "Dividends" data from the first item in the input array
const dividendData = allData[0].json['Dividends'] || '';

// Use regex to extract dividends for the past years (1-year, 2023, 2022, 2021, and 2020)
const dividendMatches = [...dividendData.matchAll(/(1 an|2024|2023|2022|2021) EUR ([0-9,.]+) ([0-9,.]+%)/g)];

// Format the extracted dividend data
const historicDividends = dividendMatches.map(match => ({
  period: match[1],
  dividendInEUR: match[2],
  yieldInPercentage: match[3]
}));

// Extract the "Performance depuis 5 ans" data from the first item in the input array
const performanceDataRaw = allData[0].json['Performance depuis 5 ans'] || '';

// Use regex to extract the performance for "5 ans"
const performance5YearsMatch = performanceDataRaw.match(/5 ans ([+-]?[0-9,.]+%)/);
const performance5Years = performance5YearsMatch ? performance5YearsMatch[1] : null;

// Use regex to extract "Rendement actuel de distribution"
const rendementMatch = dividendData.match(/Rendement actuel de distribution ([0-9,.]+%)/);
const rendementActuelDeDistribution = rendementMatch ? rendementMatch[1] : null;

// Use regex to extract "Frais"
const fraisMatch = allData[0].json['Frais'] ? allData[0].json['Frais'].match(/([\d,.]+%)/) : null;
const frais = fraisMatch ? fraisMatch[1].replace(' p.a.', '') : null; // Clean the fees to return just the percentage

//return the name
const fullName = $json["Name"];
const nameOnly = fullName.split('\n')[0].trim();


// Return the structured output
return {
  historicDividends,
  performance5Years, // Now returns just the performance for 5 years
  rendementActuelDeDistribution,
  frais,
  nameOnly
};
